export const receiveUserInfo = (user) => ({
    type: 'RECEIVE_USER_DATA',
    user,
})
export const requestUserInfo = () => ({
    type: 'REQUEST_USER_DATA',
})
export const receiveUserInfoError = () => ({
    type: 'RECEIVE_USER_ERROR',
})
export const logOutUser = () => ({
    type: 'LOGOUT',
})
